  }, []);

  return (
    <div>
      <h1>Contacts</h1>
      {contacts.map((contact) => (
        <div key={contact.id}>
          <h4>{contact.institution}</h4>
          <p>{contact.certification}</p>
          <p>{contact.description}</p>
          <p>{contact.year}</p>
